SoCal Luchadors Famous B nd Amos Da Strangla + Sideshow Wrestling's Ace on Awesome Bomb Fight Radio

One week before Sensei and Violence Jack make their debut for Sideshow Wrestling Awesome Bomb Fight radio brings back Ace to iron things out between the promotion and the talent!

Plus! 2 Weeks away from the huge XWW event in El Monte, CA the high flying badass Famous B and the sick Hybrid fighter/wrestler Amos Da Strangla come in to discuss their matches and other wrestling, booze and drug related topics. Also starring Mr California and 60 seconds with K Ross

